def get_station_coordinates(station_ids):
    base_url = "https://www.ndbc.noaa.gov/station_page.php?station="
    station_coordinates = {}
    
    for station_id in station_ids:
        url = f"{base_url}{station_id}"
        response = requests.get(url)
        
        if response.status_code == 200:
            soup = BeautifulSoup(response.text, 'html.parser')
            
            # Locate the latitude and longitude text in the format "32.499 N 118.052 W"
            location_text = soup.find(text=lambda text: text and "N" in text and "W" in text and "(" in text)
            if location_text:
                
                lat_long_value = location_text.strip().split()
                
                # Extract latitude and longitude from the text
                #lat_str, long_str = lat_long_value.split(" ")
                
                # Convert to float and handle N/S and E/W for sign
                # latitude = float(lat_str.replace("N", "").replace("S", "-").strip())
                # longitude = float(long_str.replace("E", "").replace("W", "-").strip())
                
                # Add to dictionary
                print(lat_long_value)
                try:
                    station_coordinates[station_id] = {"lat": lat_long_value[0] + lat_long_value[1], "long": lat_long_value[2] + lat_long_value[3]}
                except:
                    pass
        else:
            print(f"Failed to retrieve data for station {station_id}")
    
    return station_coordinates

